INSERT INTO `comments` VALUES (0,1,'2019-03-04 13:38:31',46,'Submitted report to NovAtel. I can close it now.'),(1,4,'2019-03-04 08:42:33',46,'Sent report to Lee.'),(2,6,'2019-03-04 09:44:53',46,'Freezes screen at wakeup. No login screen. Installing latest Nvidia drivers.'),(3,6,'2019-03-04 10:44:27',46,'Purged, found 410 and 375 left over files. Installing 390 from source.'),(4,7,'2019-03-04 11:09:06',46,'Adam asked if we use MS Project or any other software for Gantt Chart.'),(5,7,'2019-03-04 11:13:51',46,'Sent Adam Excel tutorial. Waiting for follow up.'),(6,8,'2019-03-04 11:20:19',46,'I found the cable and unplugged it.'),(7,8,'2019-03-04 11:27:46',46,'Alex can login now, after reboot from pulling power cable.'),(8,7,'2019-03-04 13:41:36',46,'Integration team is using a free software called Gantt Project.'),(9,6,'2019-03-04 13:42:25',46,'Installing nvidia-415 did not resolve the issue. Trying purging and installing 390.'),(10,11,'2019-03-04 13:59:41',46,'I set the temp to away and on hold.'),(11,6,'2019-03-04 14:17:00',46,'Installing 390 appears to work well.'),(12,9,'2019-03-04 15:14:24',46,'Appears to be a real email.'),(13,12,'2019-03-04 15:22:38',46,'Removed 7 users from group. Sent screen shots to Tyler.'),(14,6,'2019-03-05 14:19:14',46,'Installing CUDA seems to have given the operating system solid access to the GPU. I can see now with nvidia-smi the driver and operations on the VBIOS. ACPI problem is still an issue, which I think is resolved with a kernel update. I do not think I should mainline it. The option is to use ukuu otherwise. I might want to suggest creating our own operating system in the future.'),(15,10,'2019-03-05 14:27:10',46,'Wiping drive.'),(16,5,'2019-03-05 14:32:15',46,'I suggested that we change the email. Close the email option. Have guests use the portal.'),(17,10,'2019-03-05 14:33:32',46,'Installing macOS.'),(18,10,'2019-03-05 17:04:54',46,'Done wiping.'),(19,20,'2019-03-05 18:33:02',46,'Alex from NovaTel recommends using fiber for the 10Gbps.'),(20,6,'2019-03-05 19:09:35',46,'Ian believes it could be a problem with Windows 10 hibernate.'),(21,21,'2019-03-05 20:33:30',46,'Running installation now of Windows 10 Pro.'),(22,21,'2019-03-05 21:51:35',46,'Returned computer to desk of Sneha.'),(23,6,'2019-03-05 22:08:06',46,'Ian mentioned that changing the state of hiberation on Windows might help the ACPI issue.'),(24,13,'2019-03-05 22:11:08',46,'Waiting for Loni and Chelsea to identify Scanning Group. Then will ask them about purchasing.'),(25,18,'2019-03-05 22:36:21',46,'Routinely send morning updates at 9 AM until told to stop.'),(26,16,'2019-03-06 14:35:43',46,'Dropbox is ignoring me.'),(27,13,'2019-03-06 14:36:55',46,'Updated ticket. Loni wants me to determine the pros and cons.'),(28,27,'2019-03-06 14:50:18',46,'Loni is concerned about deleting and clicking on emails that may reflect how others see them in the group.'),(29,28,'2019-03-06 14:53:26',46,'Warranty has expired.'),(30,29,'2019-03-06 15:23:09',46,'Sent Kim options.'),(31,5,'2019-03-06 15:33:48',46,'We cannot filter spam from domain level. Spam must be filtered at ZenDesk level. We cannot filter spam at this level. It is too restricted. We must shift through email manual otherwise or change email to something else and communicate that. Sent this information to Chris Warren. There is no other steps to be taken.'),(32,27,'2019-03-06 15:35:17',46,'We could use shared mailboxes. I need to put this on hold until I can brainstorm a strat to talk about this.'),(33,28,'2019-03-06 16:00:59',46,'Wrote steps on how to reset PRAM and SCM.'),(34,6,'2019-03-06 18:20:08',46,'I solved the problem with disabling acpi wakeup processes.'),(35,6,'2019-03-06 20:21:25',46,'Script resolved the issue!'),(36,38,'2019-03-06 21:16:31',46,'Posted to general group chat.'),(37,34,'2019-03-07 14:40:52',46,'Phone deployed. License set. Tutorial given. Done.'),(38,36,'2019-03-07 19:56:52',46,'They completed an update. I gave them access to the room alone.'),(39,39,'2