ant in 12 months.'),(62,102,'2019-03-12 18:48:46',46,'Session recorded and uploaded to DB.'),(63,43,'2019-03-12 18:57:48',46,'I moved over enough, I believe.'),(64,99,'2019-03-13 13:17:15',46,'Quote created and sent. About $820.'),(65,25,'2019-03-13 13:18:36',46,'Greg will send out communication that I will collect software information.'),(66,116,'2019-03-13 13:40:58',46,'TThe difference I haveÂ noticed between suspend enabled is that the LED for the power button turns off. When it is disabled, the LED for the power button does not turn off.'),(67,119,'2019-03-13 13:52:25',46,'The fix is a work around turns off ACPI via systemd, which is fighting the default settings Ubuntu runs on kernel 4.15x. It is not going to work in all circumstances. For example, I found turning the computer to suspend on login screen will usually cause a problem with wake up. We needed to balance a platform that supports the specs engineers advised me to buy while also being something that was certified to support Ubuntu. But for some reason, when it is dual booted, it is no longer supported by Dell and has this issue.'),(68,120,'2019-03-13 14:31:11',46,'We have the latest version of Excel. So whatever one version does, we should be able to do it on the latest version.'),(69,116,'2019-03-13 14:31:42',46,'Will receive new email soon.'),(70,121,'2019-03-13 14:46:24',46,'Location is in /opt/'),(71,122,'2019-03-13 14:47:43',46,'BTU is 60k or 5 tons'),(72,124,'2019-03-13 15:21:39',46,'License is for 15 not 14. We have 14 licenses.'),(73,123,'2019-03-13 16:29:55',46,'less than 1 Gbps for everthing besides fiber'),(74,127,'2019-03-13 18:23:06',46,'Told Robert what Allan was assigned.'),(75,135,'2019-03-14 19:24:00',46,'Quote given is near $300 a month.');
